import React,{useState} from 'react';
import "./Register.css"
const Register=()=>{
    return(
        <div className="Register">
            <h1>Login</h1>
            <input type="text" class="input" placeholder="Enter your Email"></input>
            <input type="text" class="input" placeholder="Enter your Name"></input>
            <input type="password" class="input" placeholder="Enter your Password"></input>
            <input type="password" class="input" placeholder="Re-Enter your Password"></input>
            <div className="button">Register</div>
        </div>
    )
}
export default Register
